css:
/** PACKAGE **/
.timekeeper {
  /** IMPORTS **/
  /** INTERNAL **/
  /** UI **/
  /** LAYOUT **/
  /** STATUS BAR **/
}
.timekeeper .ui-page {
  /** CORE **/
  background-color: #FFFFFF;
  color: #181818;
  font-size: 14px;
  height: 100%;
  padding: 20px 20px 20px 20px;
  width: 100%;
  /** IMPORTS **/
  /** INTERNAL **/
  /** GENERAL **/
  /** DASHBOARD **/
}
.timekeeper .ui-page .header {
  border-bottom: 2px solid #DDDDDD;
  margin-bottom: 15px;
}
.timekeeper .ui-page .header .icon.icon-click {
  color: #DDDDDD;
}
.timekeeper .ui-page .header h2 {
  color: #E2425C;
  font-size: 24px;
  font-weight: bold;
  margin-top: 0px;
  margin-bottom: 0px;
  padding-top: 0px;
  padding-bottom: 10px;
}
.timekeeper .ui-page .content .wrapper > div {
  margin-bottom: 30px;
}
.timekeeper .ui-page .content .wrapper .header h4 {
  color: #6D6D6D;
  font-size: 16px;
  font-weight: 600;
}
.timekeeper .ui-page .content .wrapper .collection > .item {
  margin-bottom: 10px;
  padding: 5px 5px 5px 5px;
}
.timekeeper .ui-page .content .collection > .item > .title {
  color: #2AADDF;
  font-size: 16px;
  margin: 0px 0px 0px 0px;
}
.timekeeper .ui-page .content .collection > .item > .subtitle {
  font-size: 12px;
  font-style: italic;
}
.timekeeper .ui-page #dashboard .project:hover {
  background-color: #F0F2F2;
  cursor: pointer;
}
.timekeeper .timer #status {
  color: #078DD5;
}
.timekeeper .timer .icon.icon-clock {
  color: #E2425C;
  margin-right: 2px;
}
.timekeeper .timer #clock {
  color: #00AA47;
}
.timekeeper .timer.paused #clock {
  color: #FC7008;
}
